import Theme from './Theme'

const Contact = () => {
  return (
    <div id='contact'>
      <Theme
        titleBoxStyle='contact-title-box'
        titleStyle='contact-title'
        titleValue='CONTACT ME'
      />
      <Info />
    </div>
  )
}

const Info = props => {
  return (
    <div className='contact-info'>
      <h3>EMAIL</h3>
      <p>peggylau1994@gmail.com</p>
    </div>
  )
}


export default Contact
